/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-radio-root ${classMap(context.classes.main)}"	role="radio"	aria-checked="${ifDefined(context.selected)}"	aria-readonly="${ifDefined(context.ariaReadonly)}"	aria-disabled="${ifDefined(context.ariaDisabled)}"	aria-labelledby="${ifDefined(context.ariaLabelledBy)}"	aria-describedby="${ifDefined(context.ariaDescribedBy)}"	tabindex="${ifDefined(context.tabIndex)}"	dir="${ifDefined(context.rtl)}"	@click="${context._onclick}"	@keydown="${context._onkeydown}"	@keyup="${context._onkeyup}"><div class='ui5-radio-inner ${classMap(context.classes.inner)}'><svg class="ui5-radio-svg" focusable="false" aria-hidden="true">${blockSVG1(context)}</svg><input type='radio' ?checked="${context.selected}" ?readonly="${context.readonly}" ?disabled="${context.disabled}" name="${ifDefined(context.name)}" data-sap-no-tab-ref/></div>	${ context.text ? block1(context) : undefined }${ context.hasValueState ? block2(context) : undefined }</div>`; };
const block1 = (context) => { return html`<ui5-label id="${ifDefined(context._id)}-label" class="ui5-radio-label" for="${ifDefined(context._id)}" ?wrap="${context.wrap}">${ifDefined(context.text)}</ui5-label>	`; };
const block2 = (context) => { return html`<span id="${ifDefined(context._id)}-descr" class="ui5-hidden-text">${ifDefined(context.valueStateText)}</span>	`; };

const blockSVG1 = (context) => {return svg`<circle class="ui5-radio-svg-outer" cx="50%" cy="50%" r="50%" /><circle class="ui5-radio-svg-inner" cx="50%" cy="50%" r="22%" />`};
export default block0;
